import React, { useState, useEffect } from 'react';
import {Box, Typography, Button, Select, MenuItem, TextField} from '@mui/material';

function PersonForm() {
    const [persons, setPersons] = useState([]);
    const [personData, setPersonData] = useState([]);
    const [selectedPerson, setSelectedPerson] = useState(null);
    const [newPersonName, setNewPersonName] = useState('');


    useEffect(() => {
        fetch('./data/persons.json')
            .then(response => response.json())
            .then(data => setPersonData(data.persons))
            .catch(error => console.error('Error fetching data:', error));
    }, []);

    const handleAddPerson = (event) => {
        event.preventDefault();
        const newPerson = {
            id: PersonForm.length + 1, // Generate a new ID for the group
            name: newPersonName,
            person: [] // Initialize persons array for the new group
        };
        setPersons([...persons, newPerson]);
        setNewPersonName(''); // Clear the input field after adding the group
    };
    const handleSelectPerson = (event) => {
        const selectedId = event.target.value;
        const person = personData.find(person => person.id === selectedId);
        setSelectedPerson(person);
    };
    const handleNewPersonNameChange = (event) => {
        setSelectedPerson(event.target.value);
    };


    return (
        <>
            <form onSubmit={handleAddPerson}>
                <TextField
                    label="Add New Person"
                    fullWidth
                    value={newPersonName}
                    onChange={handleNewPersonNameChange}
                />
                <div className="submitButtonContainer">
                    <Button variant="contained" color="primary" type="submit">Add Person</Button>
                </div>
            </form>
            <Box
                sx={{
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    flexDirection: 'column',
                    padding: '20px',
                }}
            >
                <Typography variant="h5" gutterBottom>
                    Select a Person:
                </Typography>
                <Select
                    value={selectedPerson ? selectedPerson.id : ''}
                    onChange={handleSelectPerson}
                    variant="outlined"
                    margin="normal"
                    style={{width: '200px', marginBottom: '20px'}}
                >
                    {personData.map(person => (
                        <MenuItem key={person.id} value={person.id}>
                            {person.name}
                        </MenuItem>
                    ))}
                </Select>
                {selectedPerson && (
                    <Box
                        sx={{
                            display: 'flex',
                            justifyContent: 'center',
                            flexDirection: 'row',
                            flexWrap: 'wrap',
                        }}
                    >
                        <Box
                            sx={{
                                border: '1px solid #ccc',
                                borderRadius: '5px',
                                padding: '10px',
                                margin: '10px',
                                maxWidth: '200px',
                            }}
                        >
                            <Typography variant="h6" gutterBottom>
                                ID: {selectedPerson.id}
                            </Typography>
                        </Box>
                        <Box
                            sx={{
                                border: '1px solid #ccc',
                                borderRadius: '5px',
                                padding: '10px',
                                margin: '10px',
                                maxWidth: '200px',
                            }}
                        >
                            <Typography variant="h6" gutterBottom>
                                Name: {selectedPerson.name}
                            </Typography>
                        </Box>
                        <Box
                            sx={{
                                border: '1px solid #ccc',
                                borderRadius: '5px',
                                padding: '10px',
                                margin: '10px',
                                maxWidth: '200px',
                            }}
                        >
                            <Typography variant="h6" gutterBottom>
                                User Name: {selectedPerson.user_name}
                            </Typography>
                        </Box>
                        <Box
                            sx={{
                                border: '1px solid #ccc',
                                borderRadius: '5px',
                                padding: '10px',
                                margin: '10px',
                                maxWidth: '200px',
                            }}
                        >
                            <Typography variant="h6" gutterBottom>
                                Password: {selectedPerson.pwd}
                            </Typography>
                        </Box>
                        <Box
                            sx={{
                                border: '1px solid #ccc',
                                borderRadius: '5px',
                                padding: '10px',
                                margin: '10px',
                                maxWidth: '200px',
                            }}
                        >
                            <Typography variant="h6" gutterBottom>
                                Expenses:
                            </Typography>
                            {selectedPerson.expenses.map((expense, index) => (
                                <Typography key={index} variant="body1">
                                    {/* Render individual expense details here */}
                                </Typography>
                            ))}
                        </Box>
                    </Box>
                )}
            </Box>

        </>
    );
}

export default PersonForm;
